import styled from 'styled-components';

const Row = styled.div`
	position: relative;
	height: auto;
	min-height: 1px;
	width: 100%;
	display: grid;
	grid-template-columns: ${(props) => props.columns};
	gap: 20px;
	height: 300px
	align-items: center;
	justify-content: center;
`;

